import React from 'react';

const ModuleFooterPaymentMethods = () => {
    return (
        <p className="ps-footer__payment-method">
            <a href="#">
                <img src="/static/img/payment-method/1.png" alt="" />
            </a>
            <a href="#">
                <img src="/static/img/payment-method/2.png" alt="" />
            </a>
            <a href="#">
                <img src="/static/img/payment-method/3.png" alt="" />
            </a>
            <a href="#">
                <img src="/static/img/payment-method/4.png" alt="" />
            </a>
            <a href="#">
                <img src="/static/img/payment-method/5.png" alt="" />
            </a>
        </p>
    );
};

export default ModuleFooterPaymentMethods;
